function tierTotalLess(arr, tierTotal) {
  return arr.filter(t => {
    let n = 0;
    t.map(h => n += h[h.length - 1]);
    if (n < tierTotal)
      return t
  })
}

function checkBuilds(arr, allience, number) {
  return arr.filter(t => {
    let n = 0;
    t.map(h => h.slice(1).map(e => {
      if (e == allience) { n++ }
    }));
    if (number == 0) {
      if (n < 2)
        return t
    } else if (n > number - 1)
      return t
  })
}

